import React from 'react';
import Card from '../Card/Card';

const Orders = () => {
    return (
        <div className='shop-container'>
            <div>
            <h1>Orders Page</h1>
            </div>
            <div>
                <Card card={[]}></Card>
            </div>
        </div>
    );
};

export default Orders;
